// Get outputs from both agents
const summarySkillsData = $('Summary & Skills Agent').first().json.output;

// Format skills with ALL CAPS category on separate line, indented items
const formattedSkills = summarySkillsData.skills.map(skillGroup => {
  return `• ${skillGroup.category.toUpperCase()}\n  ${skillGroup.items}`;
}).join('\n');


// Return the formatted output
return [{
  json: {
    summary: summarySkillsData.summary,
    skills: formattedSkills
  }
}];

