const rows = items.map(item => item.json);
const skills = {};

rows.forEach(r => {
  if (!skills[r.Category]) skills[r.Category] = [];
  skills[r.Category].push({
    skill: r.Skill,
    level: r.Level,
    evidence: r.Evidence
  });
});

return [{
  json: {
    MasterSkills: Object.keys(skills).map(cat => ({
      category: cat,
      items: skills[cat]
    }))
  }
}];

// 1) Collect existing IDs from positive + negative sheets

const positiveItems = $items('Get Positive Job IDs');   // Master
const negativeItems = $items('Get Negative Job IDs');   // Unwanted

const positiveIds = positiveItems.map(i => String(i.json['Job ID']));
const negativeIds = negativeItems.map(i => String(i.json['Job ID']));

// Merge into one Set for fast lookup
const skipIds = new Set([...positiveIds, ...negativeIds]);

// 2) New jobs from scraper (HTTP Request node)

const scrapedItems = $items('HTTP Request');   // jobs returned by API
const scrapedJobs = scrapedItems.map(i => i.json);

// 3) Keep only jobs whose ID is NOT in skipIds

const uniqueJobs = scrapedJobs.filter(job =>
  !skipIds.has(String(job.id || job['Job ID']))
);

console.log('Skip IDs:', skipIds.size);
console.log('Scraped:', scrapedJobs.length);
console.log('Unique:', uniqueJobs.length);

// 4) Output unique jobs to the loop

return uniqueJobs.map(job => ({ json: job }));
